import React, { useEffect, useState } from 'react';
import { makeStyles } from '@mui/core/styles';
import { Table, TableBody, TableCell, TableHead, TableRow, Button } from '@material-ui/core';
import ABTestService from '../../services/api';
import { TestResultResponse } from '../../services/types';

const TestResult: React.FC = () => {
  const useStyles = makeStyles((theme) => ({
    testResults: {
      padding: '20px',
    },
    heading: {
      marginBottom: '20px',
    },
    table: {
      width: '100%',
      borderCollapse: 'collapse',
      marginBottom: '20px',
    },
    tableHeaderCell: {
      padding: '10px',
      border: '1px solid #ccc',
      backgroundColor: '#f7f7f7',
      color: '#333',
      fontWeight: 'bold',
    },
    tableCell: {
      padding: '10px',
      border: '1px solid #ccc',
      textAlign: 'center',
    },
    winnerCell: {
      fontWeight: 'bold',
    },
    refreshButton: {
      marginTop: '10px',
    },
    balloonEmoji: {
      marginRight: theme.spacing(1),
    },
  }));

  const classes = useStyles();
  const [resultData, setResultData] = useState<TestResultResponse[]>([]);
  const [experiment_ids, setExperimentIds] = useState<number[]>([]);

  const fetchExperimentIds = async () => {
    try {
      const experimentIdsResponse = await ABTestService.getExperimentIds();
const experimentIds: number[] = experimentIdsResponse.map(id => parseInt(id));

      setExperimentIds(experimentIds);
    } catch (error) {
      console.error('Error fetching experiment ids:', error);
    }
  };

  const fetchResults = async () => {
    if (experiment_ids) {
      const results = [];
      for (const id of experiment_ids) {
        try {
          const response = await ABTestService.getTestResults(id);
          results.push(response);
        } catch (error) {
          console.error('Error fetching results for id ' + id + ':', error);
        }
      }
      setResultData(results);
    }
  };

  useEffect(() => {
    fetchExperimentIds();
  }, []);

  useEffect(() => {
    fetchResults();
    const interval = setInterval(fetchResults, 15000);
    return () => clearInterval(interval);
  }, [experiment_ids]);

  const renderMetricsTable = () => {
    if (!resultData) {
      return null;
    }

    return resultData.map((result, index) => {
      const { metrics, confidence_interval, status, variants, winner, date_created } = result;
      
      return (
        <div key={index}>
          <h2 className={classes.heading}>Test Results</h2>
          <p>Date Created: {date_created}</p>
          <Table className={classes.table}>
            <TableHead>
              <TableRow>
                <TableCell>Variant</TableCell>
                <TableCell>Impressions</TableCell>
                <TableCell>Click Through Rate</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {variants.map((variant) => (
                <TableRow key={variant}>
                  <TableCell>{variant}</TableCell>
                  <TableCell>{metrics[variant].views}</TableCell>
                  <TableCell>{metrics[variant].clickThroughRate.toFixed(2)}%</TableCell>
                </TableRow>
              ))}
              
                  
                
              </TableBody>
            </Table>
            <p>Status: {status}</p>
            <p>Confidence Interval: {confidence_interval.toFixed(2)}</p>
            {winner && (
              <p>
                Winner: {winner ? <span className={classes.balloonEmoji}>🎈</span> : ''}  
              </p>
            )}
          </div>
        );
      });
    };
  
    return (
      <div className={classes.testResults}>
        {renderMetricsTable()}
        <Button
          variant="contained"
          color="primary"
          className={classes.refreshButton}
          onClick={fetchResults}
        >
          Refresh
        </Button>
      </div>
    );
  };
        
  export default TestResult;
